import React from 'react'
import { LoadScript, GoogleMap, Marker, InfoWindow, Polyline } from '@react-google-maps/api';
export default function Testmap({totalLine}) {
    //console.log(totalLine);

    const center = {
        lat : 37.666169,
        lng  : 128.710769
    };
    const options300 = {
        strokeColor:'#4a148c',
        strokeOpacity: 0.75,
        strokeWeight: 6,
    };
    const options200 = {
        strokeColor:'#1565c0',
        strokeOpacity: 0.75,
        strokeWeight: 4,
    };
    const options100 = {
        strokeColor:'#f57f17',
        strokeOpacity: 0.75,
        strokeWeight: 2,
    };
    const bw300_1 = () =>{
        console.log(`bw300_1`);
    }
    /*const bw300 = () =>{
        totalLine.filter((value,index,arr)=>{
            //console.log(value);
            return value.line === 1 && value.bw === 300 ? {lat : value.lat , lng : value.lng} : null
        }).map((value,index,arr)=>{
            console.log(arr[index])
            console.log(arr[index+1])
            return (
                <Polyline
                    path={[arr[index],arr[index+1]]}
                    options={options300}
                />
            );
        })
    }*/
    const bw300 = totalLine.filter((value,index,arr)=>{
            //console.log(value);
            return value.line === 1 && value.bw === 300 ? {lat : value.lat , lng : value.lng} : null
        }).map((value,index,arr)=>{
            //console.log(arr[index])
            //console.log(arr[index+1])
            return (
                <Polyline
                    path={[arr[index],arr[index+1]]}
                    options={options300}
                />
            );
        })
    const bw200 = totalLine.filter((value,index,arr)=>{
        console.log(value);
        return value.line === 1 && value.bw === 200 ? {lat : value.lat , lng : value.lng} : null
    }).map((value,index,arr)=>{
        console.log(arr[index])
        console.log(arr[index+1])
        return (
            <Polyline
                path={[arr[index],arr[index+1]]}
                options={options200}
            />
        )
    })

    return (
        <div>
            <LoadScript googleMapsApiKey="AIzaSyDevvetng60XedeOqk-qW9TF-XBNQsyxdE">
                <GoogleMap
                    mapContainerStyle={{
                        width : '1900px',
                        height : '700px',
                        margin : '20px'
                    }}
                    center={center}
                    zoom={13}
                >
                    {
                        totalLine.map((value)=>{
                            //console.log(value);
                            return(
                                <Marker 
                                    position={value}
                                />
                            );
                        })
                    }
                    
                    
                    {/*
                        totalLine.filter((value,index,arr)=>{
                            return value.line === 1 && value.bw === 300 ? {lat : value.lat , lng : value.lng} : null
                        }).map((value,index,arr)=>{
                            return (
                                <Polyline
                                    path={[arr[index],arr[index+1]]}
                                    options={options300}
                                />
                            );
                        })
                    */}
                    {/*
                        totalLine.filter((value,index,arr)=>{
                            return value.line === 1 && value.bw === 200 ? {lat : value.lat , lng : value.lng} : null
                        }).map((value,index,arr)=>{
                            return (
                                <Polyline
                                    path={[arr[index],arr[index+1]]}
                                    options={options200}
                                />
                            );
                        })
                    */}
                    {
                        totalLine.filter((value,index,arr)=>{
                            return value.line === 1 && value.bw === 100 ? {lat : value.lat , lng : value.lng} : null
                        }).map((value,index,arr)=>{
                            return (
                                <Polyline
                                    path={[arr[index],arr[index+1]]}
                                    options={options100}
                                />
                            );
                        })
                    }

                    {
                        totalLine.filter((value,index,arr)=>{
                            return value.line === 2 && value.bw === 300 ? {lat : value.lat , lng : value.lng} : null
                        }).map((value,index,arr)=>{
                            return (
                                <Polyline
                                    path={[arr[index],arr[index+1]]}
                                    options={options300}
                                />
                            );
                        })
                    }
                    {
                        totalLine.filter((value,index,arr)=>{
                            return value.line === 2 && value.bw === 200 ? {lat : value.lat , lng : value.lng} : null
                        }).map((value,index,arr)=>{
                            return (
                                <Polyline
                                    path={[arr[index],arr[index+1]]}
                                    options={options200}
                                />
                            );
                        })
                    }
                    {
                        totalLine.filter((value,index,arr)=>{
                            return value.line === 2 && value.bw === 100 ? {lat : value.lat , lng : value.lng} : null
                        }).map((value,index,arr)=>{
                            return (
                                <Polyline
                                    path={[arr[index],arr[index+1]]}
                                    options={options100}
                                />
                            );
                        })
                    }

                    {
                        totalLine.filter((value,index,arr)=>{
                            return value.line === 3 && value.bw === 300 ? {lat : value.lat , lng : value.lng} : null
                        }).map((value,index,arr)=>{
                            return (
                                <Polyline
                                    path={[arr[index],arr[index+1]]}
                                    options={options300}
                                />
                            );
                        })
                    }
                    {
                        totalLine.filter((value,index,arr)=>{
                            return value.line === 3 && value.bw === 200 ? {lat : value.lat , lng : value.lng} : null
                        }).map((value,index,arr)=>{
                            return (
                                <Polyline
                                    path={[arr[index],arr[index+1]]}
                                    options={options200}
                                />
                            );
                        })
                    }
                    {
                        totalLine.filter((value,index,arr)=>{
                            return value.line === 3 && value.bw === 100 ? {lat : value.lat , lng : value.lng} : null
                        }).map((value,index,arr)=>{
                            return (
                                <Polyline
                                    path={[arr[index],arr[index+1]]}
                                    options={options100}
                                />
                            );
                        })
                    }
                </GoogleMap>
            </LoadScript>
        </div>
    )
}
